import React, { Component } from 'react';
import './style.css';
import Job from './job';

class Work extends Component{
   constructor(){
    super()
    this.state={
        job:[
            {
                img_url:"https://cdn-icons-png.flaticon.com/512/5024/5024467.png",
                name:"MOBILE UX"
            },
            {
                img_url:"https://cdn-icons-png.flaticon.com/512/3159/3159310.png",
                name:"WEB DESIGN"
            },
            {
                img_url:"https://cdn-icons-png.flaticon.com/512/13/13706.png",
                name:"HTML TEMPLATES"
            }
        ]
    }
   } 
   render(){
    return(
        <React.Fragment>
        
    <div id='work_container'>
          <h1>  MY WORK</h1> 
        {this.state.job.map((obj)=>
        <Job name={obj.name} img_url={obj.img_url}/>
        )}
    </div>
    </React.Fragment>
        
 
    )
   }
}
export default Work;
